import React from 'react';
import styled from 'styled-components';

function Menubar() {
    return (
        <div 
        style={{
             backgroundColor: 'white',
             position: 'fixed',
             height: '100vh',
             width: '30vw'
        }}>
            <div>업체소개</div>
            <div>갤러리</div>
            <div>공지사항</div>
            <div>온라인문의</div>
            <div>오시는길</div>
        </div>
    )
}

export default Menubar

const Menu = styled.div`
    font-size: '20px';
`;
